      | 352891 -> { ItemTypeData.id= 352891; name= "Submachine Gun"; published= false; description= "Favoring function over form, the SMG is a lightweight, semi-automatic weapon designed for close-quarters combat. What it lacks in stopping power and accuracy it grossly overcompensates for with quantity. Designed to injure and impede, the hailstorm of bullets the SMG produces is most effective in tight spaces against multiple targets.  This original design is a paradigm of Minmatar construction. An inelegant, but reliable weapon solution that is simple to produce, easily repaired using almost any available materials, and provides comparable pound-for-pound performance with similar sub-automatic weapons. Although an unabashedly low-tech weapon, it excels at what it was designed for: killing anything right in front of you."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
