      | 47535 -> { ItemTypeData.id= 47535; name= "Dominix Navy Issue Glittering Dream SKIN (Permanent)"; published= true; description= "The Glittering Dream nightclub is one of the most famous venues situated on Caille's astounding Crystal Boulevard, noted for the exclusivity of its clientele as much as for an architecture that triples down on the synthetic diamond setting of the boulevard it sits on.    A major tourist attraction, the sparkling slabs of the Crystal Boulevard obscure a deep, dark purpose as beneath it lies the continuity of government and military command bunker complex for the planet of Gallente Prime.    Similarly, the towering triple helix spire of the Glittering Dream nightclub, fashioned without and within from expensive crystalline carbonides, appears to be just a high-class nightclub. Here though is where the political, military, business and even criminal elite of Luminaire meet to discuss their most secret affairs in assurance of privacy and confidentiality."; marketGroupId= Some(2108); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 47632 -> { ItemTypeData.id= 47632; name= "Ishtar Capsuleer Day XV SKIN (Permanent)"; published= true; description= "Mark the 15th anniversary of the dawn of the Capsuleer Age with the Capsuleer Day XV nanocoating. Since YC105, the world of New Eden has been transformed by the growth of the Capsuleer space pilot community. In YC120, the Capsuleers are at the forefront of space colonization and the exploration of new frontiers, making Capsuleer Day XV a moment for celebrations across New Eden."; marketGroupId= Some(2071); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 47729 -> { ItemTypeData.id= 47729; name= "Decayed Warp Scrambler Mutaplasmid"; published= true; description= "This bioadaptive mutaplasmid tool is designed to interface with and alter targeted, short-range warp field scrambling devices. As such this mutaplasmid could be used to mutate the performance characteristics of most warp scramblers.    Triglavian bioadaptive technology makes extensive use of engineered colonies of extremophilic bacteria, that are used to grow, harvest and adapt various resources found in Abyssal Deadspace. Artificial colonizing plasmids integrated into specialist tools used for direct adaptation of technology can be found in Triglavian caches in various stages of development. These mutaplasmids can be used to alter the characteristics of a wide variety of equipment types, depending on the strain and the bioadaptive tool with which they are integrated.    The mutaplasmid colony integrated into this bioadaptive tool has begun to decay and mutation effects will be less pronounced as a result. While possible mutational benefits are low, the risks of using this mutaplasmid are also reduced.  "; marketGroupId= Some(2441); groupId= 1964; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 1.000000; packagedVolume= 1.000000; portionSize= 1; radius= 1.000000; volume= 1.000000 } |> Some
      | 47826 -> { ItemTypeData.id= 47826; name= "Unstable Medium Energy Neutralizer Mutaplasmid"; published= true; description= "This bioadaptive mutaplasmid tool is designed to interface with and alter energy charge neutralization devices. As such this mutaplasmid could be used to mutate the performance characteristics of most energy neutralizers in the correct size class.    Triglavian bioadaptive technology makes extensive use of engineered colonies of extremophilic bacteria, that are used to grow, harvest and adapt various resources found in Abyssal Deadspace. Artificial colonizing plasmids integrated into specialist tools used for direct adaptation of technology can be found in Triglavian caches in various stages of development. These mutaplasmids can be used to alter the characteristics of a wide variety of equipment types, depending on the strain and the bioadaptive tool with which they are integrated.    The mutaplasmid colony integrated into this bioadaptive tool is highly unstable, with a high rate of reproduction and mutation. The mutational benefits of using this mutaplasmid are potentially very high but the risks are also extreme."; marketGroupId= Some(2454); groupId= 1964; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 1.000000; packagedVolume= 1.000000; portionSize= 1; radius= 1.000000; volume= 1.000000 } |> Some
      | 47923 -> { ItemTypeData.id= 47923; name= "Veles Supratidal Entropic Disintegrator"; published= true; description= "This large Entropic Disintegrator is only seen in use on Triglavian battleships, these massive ships being capable of managing the considerable radiation and enormous gravitational tidal forces the weapon generates. At the energy levels of this superheavy weapon system, the tidal forces are such that special systems are built into the ship to counteract them.    Entropic Disintegrators draw on the tremendous power of the Triglavian singularity-based energy systems to convert exotic matter into a particle stream directed with locally generated entropic force. While powerful, the range of the weapon is limited by the attenuation of entropic forces, which dissipate critically beyond the optimal range. As a result this weapon has no falloff range.    The particle stream generates thermal and explosive reactions on impact, and the entropic forces resolve into a localized gravitational conduit that steadily increases the acceleration on the exotic particles. In effect, the weapon's damage potential increases to a maximum level as long as the particle stream is kept on the same target.    Requires exotic plasma charge ammo types: Baryon, Meson, and Tetryon."; marketGroupId= Some(2435); groupId= 1986; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 128; value= 3.000000 }; { DogmaAttributeValueData.attributeId = 1795; value= 0.010000 }; { DogmaAttributeValueData.attributeId = 4; value= 2000.000000 }; { DogmaAttributeValueData.attributeId = 1302; value= 47271.000000 }; { DogmaAttributeValueData.attributeId = 6; value= 54.000000 }; { DogmaAttributeValueData.attributeId = 9; value= 40.000000 }; { DogmaAttributeValueData.attributeId = 277; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 278; value= 5.000000 }; { DogmaAttributeValueData.attributeId = 1180; value= 0.010000 }; { DogmaAttributeValueData.attributeId = 30; value= 16500.00000